import React, { useEffect, useState } from "react";
import axios from "axios";

const Stok = () => {
  const [stok, setStok] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/stok")
      .then((res) => {
        setStok(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return <div>Stok</div>;
};

export default Stok;
